  private int mapTransactionCode(int code) {
    if (__checkStubProxyMatch == false || code == INTERFACE_TRANSACTION) {
      return code;
    }
    int mappedCode = code;
    if (__lastMethodIndexOfProxy == -1) {
      __lastMethodIndexOfProxy = code - 1;
    }
    if (__lastMethodIndexOfProxy < __lastMethodIndex)  {
      if (code > __lastMethodIndexOfProxy) {
        mappedCode = __lastMethodIndex + (code - __lastMethodIndexOfProxy);
      }
    }
    else if (__lastMethodIndexOfProxy > __lastMethodIndex) {
      if (code > __lastMethodIndexOfProxy)  {
        mappedCode = __lastMethodIndex + (code - __lastMethodIndexOfProxy);
      }
      else if (code > __lastMethodIndex) {
        throw new RuntimeException("Interface mismatch between Proxy and Stub " + code + " [" + __lastMethodIndex + "]. Use same interface for both client and server");
      }
    }
    return mappedCode;
  }

  /**
   * Enable or disable stub proxy mismatch check. Default enabled. Turn it off if using Remoter client with AIDL server */
  public static void setStubProxyCheck(boolean enable) {
    __checkStubProxyMatch = enable;
  }

